    [],nt"num_tags": 5,nt"name": "union-slough-national-wildlife-refuge-annual-narrative-report-calendar-year-1981",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Union
    Slough NWR outlines Refuge accomplishments during the 1981 calendar year. The report
    begins with a summary of the year's highlights and weather conditions. Land acquisition
    is covered. The report includes a planning section which discusses management planning,
    compliance with environmental and cultural resource mandates, and research and investigations.
    Refuge administration is outlined; information about personnel, funding, safety,
    and technical assistance is given. Habitat management is also covered; subjects
    include wetlands, croplands, grasslands, fire management, pest control, and WPA
    easements. The wildlife section of the report discusses wildlife diversity, endangered
    and threatened species, waterfowl, marsh birds and waterbirds, shorebirds, raptors,
    game mammals, and marking and bird banding. The public uses of the Refuge described
    in this report include outdoor classrooms, interpretive programs, hunting, fishing,
    trapping, wildlife observation, outdoor recreation, and law enforcement. The equipment
    and facilities section of the report provides information about new construction,
    rehabilitation, major maintenance, equipment replacement, and energy conservation.
    Cooperative programs and items of interest are provided at the end. Refuge brochures
    and field guides are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
